			//冒泡排序
			function bubbleSort(arr){
				var start=Date.now()
				for(var i=0;i<arr.length-1;i++){
					if(arr[i]==0){
						arr[i]=arr[i+1];
						arr[i+1]=0;
					}
					for(var j=0;j<arr.length-1;j++){
						if(arr[j]==0){
							arr[j]=arr[j+1];
							arr[j+1]=0;
						}		
					}
				}
				console.log(Date.now()-start)
			}
			//bubbleSort(a)
			function arrSort(arr){
				var start=Date.now();
				arr.sort(function(a,b){return a==0?1:-1})
				console.log(Date.now()-start);
			}
			arrSort(a);
			console.log(a)
